Required functions to start a TCP server: #include <sys/socket.h> // included by arpa/inet, socket, bind, etc.
#include <netinet/in.h> // included by arpa/inet, struct sockaddr_in
#include <arpa/inet.h> // inet_pton, htons
#include <unistd.h> // close void server() { // First, setup the address. struct sockaddr_in saddr; saddr.sin_family = AF_INET; saddr.sin_port = htons(8080); inet_pton(AF_INET, "127.0.0.1", &saddr.sin_addr); // Socket setup int s_fd = socket(AF_INET, SOCK_STREAM, 0); bind(s_fd, (struct sockaddr*)&saddr, sizeof(saddr)); listen(s_fd, 1); // Client connections int c_fd; struct sockaddr_in caddr; unsigned int caddr_len = sizeof(caddr); c_fd = accept(s_fd, (struct sockaddr*)&caddr, &caddr_len); recv(c_fd, <buf>, <size>, 0); send(c_fd, <buf>, <size>, 0); close(c_fd); close(s_fd);
} void client() { // Address struct sockaddr_in saddr; saddr.sin_family = AF_INET; saddr.sin_port = htons(8080); inet_pton(AF_INET, "127.0.0.1", &saddr.sin_addr); // Socket setup int s_fd = socket(AF_INET, SOCK_STREAM, 0); connect(s_fd, (struct sockaddr*)&saddr, sizeof(saddr)); // Communication recv(s_fd, <buf>, <size>, 0); send(s_fd, <buf>, <size>, 0); close(s_fd);
} For UDP communication: void server() { // First, setup the address. struct sockaddr_in saddr; saddr.sin_family = AF_INET; saddr.sin_port = htons(8080); inet_pton(AF_INET, "127.0.0.1", &saddr.sin_addr); // Socket setup int s_fd = socket(AF_INET, SOCK_DGRAM, 0); bind(s_fd, (struct sockaddr*)&saddr, sizeof(saddr)); // Client connections struct sockaddr_in caddr; unsigned int caddr_len = sizeof(caddr); recvfrom(s_fd, <buf>, <size>, 0, (struct sockaddr*)&caddr, &caddr_len); sendto(c_fd, <buf>, <size>, 0, (struct sockaddr*)&caddr, sizeof(caddr)); close(c_fd); close(s_fd);
} void client() { // Address struct sockaddr_in saddr; saddr.sin_family = AF_INET; saddr.sin_port = htons(8080); inet_pton(AF_INET, "127.0.0.1", &saddr.sin_addr); unsigned int saddr_len = sizeof(saddr); // Socket setup int s_fd = socket(AF_INET, SOCK_STREAM, 0); // Communication recv(s_fd, <buf>, <size>, 0, (struct sockaddr*)&saddr, &saddr_len); send(s_fd, <buf>, <size>, 0, (struct sockaddr*)&saddr, sizeof(saddr)); close(s_fd);
}

